import React, {Component} from "react";
import {ArrayBuffer} from 'base64-arraybuffer';

export default class ItemBoxComponent extends Component{

    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="box">
                <img src={"data:image/png;base64,"+ArrayBuffer.encode(this.props.item.photo)}/>
            </div>
        );
    }
}
